public void UpdateStatus(Guid caseId, UserConnection userConection)
{
	EntitySchema tableSchema = userConection.EntitySchemaManager.GetInstanceByName("Case");
	Entity entity = tableSchema.CreateEntity(userConection);
	if(entity.FetchFromDB(caseId))
	{
		entity.SetColumnValue("StatusId", "3859C6E7-CBCB-486B-BA53-77808FE6E593");
		entity.Save();
	}
}
